    <div className="app_right">
      <Twitts />
    </div>
  );
}
function FDP() {
  return (
    <div className="app_right">
      <Twitts />
    </div>
  );
}
function LINKE() {
  return (
    <div className="app_right">
      <Twitts />
    </div>
  );
}
function GRÜN() {
  return (
    <div className="app_right">
      <Twitts />
    </div>
  );
}

export default App;
